import Note from './Main/Note'
import './Main.css';
import store from '../store';

export default class Main extends Component {
    render() {
      let note = [];
      for(var i=0; i<4; i++) {
        note.push(<Note></Note>);
      }
      return(
        <div className="Main">
           {store.getState().categorySelected ?
           {note} : null 
          }
          
           </div>
      )
    }
  }
